class BPerson{

    public email: string;
    public firstname: string;
    public lastname: string;
    public age: string;
    
    constructor(email : string, firstname: string, lastname : string, age : string){
        this.email = email;
        this.firstname = firstname;
        this.lastname = lastname;
        this.age = age;        
    }
}

export default BPerson;
